import Post from './postColumn1'
import PostColum2 from './postColumn2'

const PostList = ({ info, moreInfo }) => {
  return (
    <>
      {info.map((el) => (
        <Post
          key={el.id}
          image={el.image}
          categories={el.categories}
          postDate={el.postDate}
        ></Post>
      ))}
      {moreInfo.map((el) => (
        <PostColum2
          key={el.id}
          image={el.image}
          categories={el.categories}
          postDate={el.postDate}
        ></PostColum2>
      ))}
    </>
  )
}

export default PostList
